  const renderComponent = () => {
    return (
      <>
       <div class="flip-card">
  <div class="flip-card-inner">
    <div class="flip-card-front">
      {/* <!-- Front content --> */}
      <h2>Front Side</h2>
    </div>
    <div class="flip-card-back">
      {/* <!-- Back content --> */}
      <h2>Back Side</h2>
    </div>
  </div>
  <button id="flip-button">Flip Card</button>
</div>

      </>
    );
  };
  return renderComponent();
};

export default Auth;
